/*
1926. 迷宫中离入口最近的出口
https://leetcode.cn/problems/nearest-exit-from-entrance-in-maze/description/

方法：广度优先遍历。首先把起点放入队列中，然后进入循环。
当队列不为空时，将队首元素出队,如果该元素就是出口，则直返返回结果。
否则将该元素上、下、左、右 还没有遍历过的的空格子入队。
如果循环结束还没有返回结果，则从entrance无法走出迷宫。
出现死循环bug 过几天再解决。目前定位不出问题


*/

func nearestExit(maze [][]byte, entrance []int) int {
	row, col := len(maze), len(maze[0])
	visited := make([][]bool, row)
	for i := 0; i < row; i++ {
		visited[i] = make([]bool, col)
	}
	var queue = list.New()
	queue.PushBack(entrance)

	step := 0
	for queue.Len() != 0 {
		nodeCnt := queue.Len()
		for i := 0; i < nodeCnt; i++ {
			//fmt.Println("here1")
			pos := queue.Remove(queue.Front()).([]int)
			visited[pos[0]][pos[1]] = true
			if isExit(pos[0], pos[1], row, col) && step != 0 {
				return step
			}
			// 上
			if pos[0]-1 >= 0 && maze[pos[0]-1][pos[1]] == '.' && !visited[pos[0]-1][pos[1]] {
				queue.PushBack([]int{pos[0] - 1, pos[1]})
			}
			// 下
			if pos[0]+1 < row && maze[pos[0]+1][pos[1]] == '.' && !visited[pos[0]+1][pos[1]] {
				queue.PushBack([]int{pos[0] + 1, pos[1]})
			}

			// 左
			if pos[1]-1 >= 0 && maze[pos[0]][pos[1]-1] == '.' && !visited[pos[0]][pos[1]-1] {
				queue.PushBack([]int{pos[0], pos[1] - 1})
			}

			// 右
			if pos[1]+1 < col && maze[pos[0]][pos[1]+1] == '.' && !visited[pos[0]][pos[1]+1] {
				queue.PushBack([]int{pos[0], pos[1] + 1})
			}
		}
		step++
	}

	return -1

}

func isExit(x, y, row, col int) bool {
	if x == 0 || x == row-1 || y == 0 || y == col-1 {
		return true
	}
	return false
}

